Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read
      .textFile("path/to/onsite/data")
      .javaRDD

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read
      .textFile("path/to/top/queries")
      .javaRDD

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Calculate hit rate
    val hitRate = onsiteData.mapPartitions(iter => {
      val cache = mutable.Map[String, (Long, Boolean)]()
      val cacheMisses = new ListBuffer[String]()

      iter.foreach { line =>
        val Array(query, timestamp) = line.split("\\s+")

        if (broadcastTopQueries.value.contains(query)) {
          val currentTime = System.currentTimeMillis()
          val cacheEntry = cache.getOrElseUpdate(query, (currentTime, false))

          if (!cacheEntry._2) {
            // Cache miss
            cacheMisses += query
            cache.put(query, (currentTime, true))
          } else if (currentTime - cacheEntry._1 > 12 * 60 * 60 * 1000) {
            // Cache expired
            cacheMisses += query
            cache.put(query, (currentTime, true))
          }
        }
      }

      Iterator(cacheMisses.size.toDouble / iter.size)
    }).reduce(_ + _) / onsiteData.getNumPartitions

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from their respective paths. It then broadcasts the top frequent queries to all nodes in the cluster.

Next, it calculates the hit rate by iterating over each partition of the onsite attributed data. For each record, it checks if the query is present in the top frequent queries and if it's the first time the query is encountered or if the cache has expired. If either of these conditions is true, it counts as a cache miss and the query is added to the cache.

Finally, it calculates the hit rate by dividing the number of cache misses by the total number of records in the onsite attributed data and returns the result.

